import Vue from 'vue'
import App from './App.vue'
//引入VueRouter
import VueRouter from 'vue-router'
//引入路由
import router from './router/index'
//关闭生产提示
Vue.config.productionTip = false
//应用插件
Vue.use(VueRouter)

new Vue({
  el:'#app',
  beforeCreate() {
    Vue.prototype.$bus = this
  },
  render: h => h(App),
  router
})
